import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import App from "./App-2";

export default function Main(){
    return(
            <Router>
                <App></App>
                <Routes>
                    <Route path="/" exact element={<App />}/>
                </Routes>
            </Router>
    )
}
